__NUXT_JSONP__("/drugs/Dusigitumab", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1204390-13-5",chebiId:b,chemicalFormula:b,definition:"A humanized monoclonal antibody directed against insulin-like growth factors 1 and 2 (IGF-1\u002F2) with potential antineoplastic activity. Dusigitumab inhibits IGF1- and IGF2-stimulated activation of membrane-bound IGF receptors and the subsequent triggering of proliferation and survival signaling pathways. This may result in the inhibition of tumor cell proliferation and the induction of tumor cell apoptosis. IGF1\u002F2 ligands stimulate cell proliferation, enable oncogenic transformation, and suppress apoptosis; IGF1\u002F2 signaling has been highly implicated in tumorigenesis and metastasis.",fdaUniiCode:"0Z70DT5PRX",identifier:"C82683",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C129822","C20401"],synonyms:["Anti-Insulin-Like Growth Factor 1\u002F2 Monoclonal Antibody MEDI-573","DUSIGITUMAB",a,"Immunoglobulin G2, Anti-(Human Insulin-like Growth Factor I\u002FInsulin-like Growth Factor II); Human Monoclonal MEDI-573 gamma Heavy Chain (134-216')-Disulfide with Human Monoclonal MEDI-573 lambda Light Chain Dimer (222-222'':223-223'':226-226'':229-229'')-Tetrakisdisulfide","MEDI-573"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDusigitumab",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Dusigitumab","","2021-10-30T13:46:05.043Z")));